---
openapi: 3.0.0
info:
  title: Party Account Relationship Service - Get Party Account Relationship
  description: Party Account Relationship service manages the nature of relationship between a party and a product account. It is used to indicate the primary contact and tax responsible parties as well as state the relationship type between the party and an account.
  version: 11.0.0_GetPartyAcctRel
servers:
- url: /
paths:
  /partyacctrel/secured:
    post:
      tags:
      - Get Party Account Relationship
      summary: Get Party Account Relationship.
      description: "Retrieves the relationship-related information between Party and account, such as:<br>\n  <ul>\n  <li>List of all Parties (person or organization) related to an account</li> \n  <li>List of all accounts related to a Party</li>\n  </ul>\n  \nFor more information about the Accountholder domain, <a href=\"../docs/?path=docs/fintechs/accountholder.md\" title=\"Click to open\">click here.</a> <br><br> <b>Relates to:</b>\n  <ul> \n    <li><a href=\"../docs/?path=docs/banks-and-CU/deposits.md\" title=\"Click to open\">Deposits</a></li>\n    <li><a href=\"../docs/?path=docs/banks-and-CU/loans.md\" title=\"Click to open\">Loans</a></li>\n    <li><a href=\"../docs/?path=docs/banks-and-CU/bank-servicing.md\" title=\"Click to open\">Bank Servicing</a></li>\n    <li><a href=\"../docs/?path=docs/banks-and-CU/riskMgt.md\" title=\"Click to open\">Risk and Performance Management</a></li>\n  </ul>\n  \n  <br>\n  <blockquote style=\"border-left: 0.375em solid #40a9ff; background-color: #e6f7ff; border-radius: 3px; padding: 1em;\" > To view provider specific implementation notes and applicable fields, <a target=\"_blank\" title=\"Click to open in a new tab\" href=\"../docs/?path=docs/implementation-notes/Accountholder/PartyAcctRelInq-ImplNotes.md\">click here</a>.</blockquote>"
      operationId: PartyAcctRelInqBySecured
      parameters:
      - name: EFXHeader
        in: header
        description: EFX Header is a common and required component for all API calls, it contains authentication and client-related parameters. Please note that the header parameters should be sent as a JSON object under the EFXHeader parameter. To view the list of header parameters, <a href="../docs?path=docs/api-ref-EFX-header.md" title="Click to open"> click here.</a>
        required: true
        schema:
          $ref: '#/components/schemas/EFXHeader'
      requestBody:
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/PartyAcctRelInqRqType'
            examples:
              Sample by Account:
                $ref: '#/components/examples/PremierPartyAcctRelInqRequest-byAcct'
              Sample by Party:
                $ref: '#/components/examples/PremierPartyAcctRelInqRequest-byParty'
      responses:
        "200":
          description: Ok
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/PartyAcctRelInqRsType'
              examples:
                Sample by Account:
                  $ref: '#/components/examples/PremierPartyAcctRelInqResponse-byAcct'
                Sample by Party:
                  $ref: '#/components/examples/PremierPartyAcctRelInqResponse-byParty'
        default:
          description: To view the complete list of response codes, <a href="../docs/?path=docs/response-codes.md" title="Click to open">click here.</a>
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/PartyAcctRelInqRsType'
      x-group-name: Party Account Relationship Service
      x-proxy-name: Get Party Account Relationship
      x-child-product-name: Accountholder
